import React from "react";
import Container from "@mui/material/Container";

const Footer = () => {
  return (
    <>
      <Container sx={{ backgroundColor: "#636B74", height: "auto" }}>
        <Grid container rowSpacing={1} columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
          <Grid item xs={3}>
          </Grid>
          <Grid item xs={3}>
          </Grid>
          <Grid item xs={3}>
          </Grid>
          <Grid item xs={3}>
            <Item>4</Item>
          </Grid>
        </Grid>
      </Container>
    </>
  );
};

export default Footer;
